import React, {useState, useEffect} from 'react';
import './style.css';
import { PieChart } from "react-minimal-pie-chart";


function AdminDashboardPage() {
  const [weakCounter, setWeakCounter] = useState(0);
  const [fairCounter, setFairCounter] = useState(0);
  const [goodCounter, setGoodCounter] = useState(0);
  const [strongCounter, setStrongCounter] = useState(0);
  const [passwordCounter, setPasswordCounter] = useState(0);
  const [passwordInformation, setPasswordInformation] = useState(0);



  useEffect(() => {
    async function retrievePasswords() {
      var dataObject = [];
      var weak = 0;
      var fair = 0;
      var good = 0;
      var strong = 0;
      var passwordCounter = 0;

      const response_password = await fetch("http://localhost:3001/retrievePasswords", {
        method: 'GET',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json'
        }
      });

      const response_student = await fetch("http://localhost:3001/retrieveStudents", {
        method: 'GET',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json'
        }
      });
      const response_passwordStrength = await fetch("http://localhost:3001/select_groupBy_password_strength", {
        method: 'GET',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json'
        }
      });

      const response_passwordsBasedOnStudent = await fetch("http://localhost:3001/select_passwords_based_on_student", {
        method: 'GET',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json'
        }
      });
      const response_strongestMajor = await fetch("http://localhost:3001/select_major_strongest_passwords", {
        method: 'GET',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json'
        }
      });

      const response_weakestMajor = await fetch("http://localhost:3001/select_major_weakest_passwords", {
        method: 'GET',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json'
        }
      });

      const data_password = await response_password.json();
      const data_student = await response_student.json();
      const data_passwordStrength = await response_passwordStrength.json();
      const data_passwordsBasedOnStudent = await response_passwordsBasedOnStudent.json();
      const data_strongestMajor = await response_strongestMajor.json();
      const data_weakestMajor = await response_weakestMajor.json();

      
      setWeakCounter(data_passwordStrength[0].count)
      setFairCounter(data_passwordStrength[1].count)
      setGoodCounter(data_passwordStrength[2].count)
      setStrongCounter(data_passwordStrength[3].count)
    }
      retrievePasswords()
  });


  return (
    <div className='w-100'>
      <div className="row">
        <div className='col-4'>
          <div className="card">
            <div className="card-body">
              <div className="card-title text-center">Number of Passwords</div>
                <p className='card-text text-center'>{weakCounter + fairCounter + goodCounter + strongCounter}</p>
            </div>
          </div>
        </div>
        <div className='col-4'>
          <div className="card">
            <div className="card-body">
              <div className="card-title text-center">Number of Passwords</div>
                <p className='card-text text-center'>{passwordCounter}</p>
            </div>
          </div>
        </div>
        <div className='col-4'>
          <div className="card">
            <div className="card-body">
              <div className="card-title text-center">Number of Passwords</div>
                <p className='card-text text-center'>{passwordCounter}</p>
            </div>
          </div>
        </div>
      </div>
      <div className='row'>
        <div className='col-6'>
        <div className="card">
            <div className="card-body">
              <div className="card-title text-center">Strength of Password</div>
              <PieChart
                animation
                animationDuration={500}
                animationEasing="ease-out"
                center={[50, 50]}
                data={[
                  {
                    color: '#01a917',
                    title: "strong",
                    value: strongCounter,
                  },
                  {
                    color: "#0b75ed",
                    title: "good",
                    value: goodCounter,
                  },
                  {
                    color: "#ebbd04",
                    title: "fair",
                    value: fairCounter,
                  },
                  {
                    color: "#e20b07",
                    title: "weak",
                    value: weakCounter,
                  },
                ]}
                labelPosition={50}
                lengthAngle={360}
                lineWidth={30}
                paddingAngle={0}
                radius={50}
                rounded
                startAngle={0}
                viewBoxSize={[100, 100]}
            />
            </div>
          </div>


        </div>

      </div>
      <div className="chart-container">

      </div>
    </div>
  )
}

export default AdminDashboardPage;
